import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
const App = () => {
 

  return (
    <div>
      {/* <Toaster /> */}
      <Router>
        <Navbar />
        <Routes>
          <Route path="/login" element={<Signin />} />
        </Routes>
        <Footer />
      </Router>
    </div>
  );
};

export default App;
